import React from 'react';
import GoogleMap, { Marker } from 'react-maps-google';

const Map = (props) => {
  return (
    <GoogleMap apiKey="[insert your api key here]">
      <Marker position={{lat: 40.7174343, lng: -73.9930319}} />
    </GoogleMap>
  );
}

export default Map;
